// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;
import AwCommandBar from 'viewmodel/AwCommandBarViewModel';




/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/fullScreenService', () => import('js/fullScreenService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {
        "updateCaption": {
            "actionType": "JSFunction",
            "method": "populateFullScreenHeaderCaption",
            "inputData": {
                "headerTitle": "{{props.subPanelContext.headerTitle}}",
                "headerPath": "{{props.subPanelContext.headerPath}}",
                "headerContextTitle": "{{props.subPanelContext.headerContextTitle}}"
            },
            "outputData": {
                "caption": ""
            },
            "deps": "js/fullScreenService"
        }
    },
    "lifecycleHooks": {
        "onUpdate": {
            "action": "updateCaption",
            "observers": [
                "props.subPanelContext.headerTitle",
                "props.subPanelContext.headerPath",
                "props.subPanelContext.headerContextTitle"
            ]
        }
    },
    "props": {
        "sub-panel-context": {
            "type": "object"
        }
    },
    "_viewModelId": "FullScreenHeader",
    "_uniqueViewModelId": "FullScreenHeader",
    "ctx": {}
};

/*
<div class='sw-full-screen-header aw-layout-panelTitle sw-row justify-justified'>
    <div class='aw-layout-locationTitle justify-justified'>
        {{data.caption}}
    </div>
    <div class='align-center justify-right flex-shrink sw-panel-bar'>
        <aw-command-bar class='aw-layout-workareaCommandbar' anchor="aw_fullScreenHeader" context="props.subPanelContext" alignment="HORIZONTAL"></aw-command-bar>
    </div>
</div>

*/
const renderFn =(props)=> {
    let subPanelContext = props.subPanelContext ;
    let { viewModel: { data, dataProviders, dispatch, conditions, selectionModels, editHandlers, chartProviders, ports  }, grids, ctx, actions, fields, messages, i18n, formProp, viewPath  } = props;
    data = {...data, dataProviders};
    if( subPanelContext && subPanelContext.fields ){
        fields = { ...fields, ...subPanelContext.fields };
    }
    let $index = null;
    return (
            <div className="sw-full-screen-header aw-layout-panelTitle sw-row justify-justified">
        <div className="aw-layout-locationTitle justify-justified">
            {AwParseService.instance( "data.caption" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )}
        </div>
        <div className="align-center justify-right flex-shrink sw-panel-bar">
            <AwCommandBar className="aw-layout-workareaCommandbar" anchor="aw_fullScreenHeader" context={AwParseService.instance( "props.subPanelContext" )( { props, data, fields, dataProviders, ctx, i18n, actions, subPanelContext, viewPath, conditions, formProp, dispatch, selectionModels, editHandlers, chartProviders, ports } )} alignment="HORIZONTAL">
            </AwCommandBar>
        </div>
    </div>
    )
};


/*
define component
*/
const Component = createComponent( declViewModelJson, renderFn, undefined, ctxImportObj );

export default Component;
